import React from "react";
import TimeSlot from "./TimeSlot";

const TimeSlotList = ({ timeList, setMeetingDateList }) => {
  return (
    <>
      {timeList.map((slot) => (
        <TimeSlot
          key={slot.time}
          id={slot.time}
          time={slot.time}
          isPossible={slot.isPossible}
          setMeetingDateList={setMeetingDateList}
        />
      ))}
    </>
  );
};

export default TimeSlotList;
